import React from 'react';
import AboutData from './aboutData';
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import './about_inner.css'

class AboutInner extends React.Component{
  render(){
    return(
    <div id="aboutInner">
    <h1 className="text-center">Flash Box is an Israel courier company that provides express and reliable package transport.</h1>
      <img src="/img/about/one.jpg"/>
      <div className=" col-6 float-right">
        <OwlCarousel autoplayHoverPause items={1}>
        {AboutData.map((item)=>{
          return(
            <div className='item mt-5'>
              <h4>{item.title}</h4>
              <p>{item.text}</p>
            </div>

          )
        }
        )}
            <div className='item mt-5'>
            <h4>regular customer</h4>
                <p>text:"To enjoy our services, you need to register on the site and fill in all your personal details. Then you have to choose a username, the password will be your ID.We will send you an address (the address is uniform for all customers!). When the customer places an order online, he chooses the Flash Box service or types in the address he received. As soon as the package arrives to us we send it to the customer's house, this means that he does not have to collect the package himself or go to Collection points. Rather, we send it to his home.",
                h1:"Flash Box is an Israel courier company that provides express and reliable package transport."
                </p>
            </div>
            <div className='item'>
            <p>text:"To enjoy our services, you need to register on the site and fill in all your personal details. Then you have to choose a username, the password will be your ID.We will send you an address (the address is uniform for all customers!). When the customer places an order online, he chooses the Flash Box service or types in the address he received. As soon as the package arrives to us we send it to the customer's house, this means that he does not have to collect the package himself or go to Collection points. Rather, we send it to his home.",
            h1:"Flash Box is an Israel courier company that provides express and reliable package transport."
            </p>
            </div>
        </OwlCarousel>
        </div>
    </div>
    )
  }
}
export default AboutInner
